// src/pages/SearchPage.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const SearchPage = () => {
  const [books, setBooks] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [favorites, setFavorites] = useState([]);
  const [doneReading, setDoneReading] = useState([]);
  const [error, setError] = useState(null);

  // Fetch books from the API when searchQuery changes
  useEffect(() => {
    const fetchBooks = async () => {
      if (searchQuery.trim() === '') return; // Do nothing if search query is empty

      try {
        const apiKey = process.env.REACT_APP_GOOGLE_BOOKS_API_KEY;
        const response = await axios.get(
          `https://www.googleapis.com/books/v1/volumes?q=${searchQuery}&key=${apiKey}`
        );
        setBooks(response.data.items || []);
      } catch (err) {
        console.error('API call failed:', err);
        setError('Failed to fetch books');
      }
    };

    fetchBooks();
  }, [searchQuery]);

  // Update search query as the user types
  const handleSearch = (e) => {
    setSearchQuery(e.target.value);
  };

  // Add book to the "Favorites" section
  const addToFavorites = (book) => {
    setFavorites((prevFavorites) => [...prevFavorites, book]);
  };

  // Add book to the "Done Reading" section
  const addToDoneReading = (book) => {
    setDoneReading((prevDoneReading) => [...prevDoneReading, book]);
  };

  return (
    <div className="container">
      <div className="search-bar">
        <input
          type="text"
          placeholder="Search for books..."
          value={searchQuery}
          onChange={handleSearch}
        />
      </div>
      <div className="content">
        <div className="books-section">
          {error ? (
            <div className="error-message">{error}</div>
          ) : books.length > 0 ? (
            books.map((book) => (
              <div key={book.id} className="book-card">
                <h2>{book.volumeInfo.title}</h2>
                <p>{book.volumeInfo.authors?.join(', ')}</p>
                {book.volumeInfo.imageLinks?.thumbnail && (
                  <img
                    src={book.volumeInfo.imageLinks.thumbnail}
                    alt={book.volumeInfo.title}
                    className="book-thumbnail"
                  />
                )}
                <div className="book-actions">
                  <button onClick={() => addToFavorites(book)}>Add to Favorites</button>
                  <button onClick={() => addToDoneReading(book)}>Done Reading</button>
                </div>
              </div>
            ))
          ) : (
            <p>No books found</p>
          )}
        </div>

        <div className="favorites-section">
          <h2>Favorites</h2>
          {favorites.length > 0 ? (
            favorites.map((book, index) => (
              <div key={index} className="book-card">
                <h3>{book.volumeInfo.title}</h3>
                <p>{book.volumeInfo.authors?.join(', ')}</p>
              </div>
            ))
          ) : (
            <p>No favorite books added</p>
          )}
        </div>

        <div className="done-reading-section">
          <h2>Done Reading</h2>
          {doneReading.length > 0 ? (
            doneReading.map((book, index) => (
              <div key={index} className="book-card">
                <h3>{book.volumeInfo.title}</h3>
                <p>{book.volumeInfo.authors?.join(', ')}</p>
              </div>
            ))
          ) : (
            <p>No books marked as read</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default SearchPage;
